package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import java.io.Serializable;/** * @DataReport * @(data_report) * @version : Ver 1.0 */@TableName("data_report")public class DataReport implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:主键id	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	/**	 * @备注:总会员数	 * @字段:member_count INT(10)	 */	private Integer memberCount;	/**	 * @备注:总注册数	 * @字段:register_count INT(10)	 */	private Integer registerCount;	/**	 * @备注:总放款订单数	 * @字段:order_count INT(10)	 */	private Integer orderCount;	/**	 * @备注:总放款金额	 * @字段:money_out DECIMAL(10)	 */	private java.math.BigDecimal moneyOut;	/**	 * @备注:总还款金额	 * @字段:money_in DECIMAL(10)	 */	private java.math.BigDecimal moneyIn;	public DataReport(){	}	public DataReport(		Long id	){		this.id = id;	}	public void setId(Long id) {		this.id = id;	}	public Long getId() {		return this.id;	}	public void setMemberCount(Integer memberCount) {		this.memberCount = memberCount;	}	public Integer getMemberCount() {		return this.memberCount;	}	public void setRegisterCount(Integer registerCount) {		this.registerCount = registerCount;	}	public Integer getRegisterCount() {		return this.registerCount;	}	public void setOrderCount(Integer orderCount) {		this.orderCount = orderCount;	}	public Integer getOrderCount() {		return this.orderCount;	}	public void setMoneyOut(java.math.BigDecimal moneyOut) {		this.moneyOut = moneyOut;	}	public java.math.BigDecimal getMoneyOut() {		return this.moneyOut;	}	public void setMoneyIn(java.math.BigDecimal moneyIn) {		this.moneyIn = moneyIn;	}	public java.math.BigDecimal getMoneyIn() {		return this.moneyIn;	}}